INSERT INTO `tbl_jobs` (`job_id`, `title`, `city`, `country`, `category`, `type`, `experience`, `description`, `responsibility`, `requirements`, `company`, `date_posted`, `closing_date`, `enc_id`) VALUES
('9580545210', 'Desarrollador Full Stack', 'Quito', 'Ecuador', 'Investigacion, Ciencia y Biotecnologia', 'Full-time', '1 Year', '<p>Somos una empresa global con presencia en más de 55 países y 600.000+ asociados a nivel global. En Latinoamérica estamos en 9 países (Chile, Argentina, México, Uruguay, Colombia, Guatemala, Perú, Ecuador, Brasil) y ya somos más de 26.000 asociados que hacen parte de esta gran familia latinoamericana.<br></p><p>Hoy en TCS Ecuador queremos invitarte a que te unas a nosotros y transformemos el mundo a través de la tecnología, siendo parte de nuestro equipo como DESARROLLADOR EN BIZAGI. A continuación vas a ver los requerimientos:</p>', '<p>Utilizar las herramientas y capacidades de la plataforma para transformar los procesos de negocio, haciéndolos más eficientes, automatizados y alineador con las necesidades estratégicas de la organización. <br></p>', '<p>Conocimientos:</p><ul><li>Consultoria de Automatización Bizagi, ingeniería de procesos BMP y analista BPM, BPMS, BPMN, además de especialista en BPM.</li><li>Analista de sistemas Bizagi, Bizagi developer, automatización de procesos.</li><li>Adecuado manejo del ciclo de desarrollo del Software y sus fases (ALM) desde el levantamiento hasta su implementación y soporte.</li><li>Conocimientos técnicos en Modelamiento de proceso con notación BPMN, Análisis de negocio y procesos. Metodología BPM RAD.</li><li>Análisis, Diseño y Programación Orientada a Objetos POO, SOLID o MVC.</li><li>Experiencia automatizando procesos con el BPM Bizagi Modeler (BPM Bizagi Studio), automatización de procesos de negocio, versión 10 en adelante.</li><li>Experiencia con lenguajes de programación como .NET, C# y/ Javascript o Node.Js.</li></ul>', 'CM835956647', 'September 13, 2024', '30/12/2024', 0);
