INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Nexo Byte', '', '-', '-', '-', 'Quito', 'admin@int', '-', 'Corp.', 'Condado', 'N76', '2024', 'Ecuador', '0959491061', 'Nexo Byte fue fundada en 2024 con el objetivo de ayudar a las empresas a resolver sus problemas y optimizar sus procesos tecnológicos mediante el uso de software de alta calidad. Desde el principio, nuestro enfoque ha sido mejorar el rendimiento empresarial a través de la aplicación eficiente de soluciones tecnológicas, adaptadas a las necesidades específicas de cada cliente. Con el compromiso de brindar un servicio óptimo, nuestra empresa se ha posicionado como un aliado estratégico para empresas que buscan optimizar sus operaciones mediante la tecnología.<br>', , '<p>En Nexo Byte, ofrecemos una amplia gama de servicios tecnológicos diseñados para satisfacer las necesidades únicas de cada cliente:</p><ul><li><strong>Desarrollo de Software personalizado:</strong> Creamos soluciones de software a medida para escritorio, web y móvil, adaptadas a las necesidades específicas de cada empresa.</li><li><strong>Cableado estructurado y servicios de redes LAN:</strong> Implementamos infraestructuras de red seguras y eficientes para mejorar la conectividad empresarial.</li><li><strong>Mantenimiento de equipos tecnológicos:</strong> Ofrecemos servicios completos de mantenimiento preventivo y correctivo para equipos tecnológicos.</li><li><strong>Consultoría en tecnología empresarial:</strong> Ayudamos a las empresas a definir e implementar estrategias tecnológicas que mejoren su rendimiento.</li></ul><p>Nuestro servicio principal se destaca en la <strong>creación de páginas web</strong> y la <strong>automatización de procesos manuales</strong>, brindando soluciones personalizadas que mejoran la eficiencia y productividad de nuestros clientes.</p>', '<p>Con <strong>2 años de experiencia</strong> en el desarrollo de software, hemos trabajado con clientes del sector gubernamental, como el <strong>Comando Conjunto de las Fuerzas Armadas</strong> y el <strong>Municipio de Cayambe</strong> en Ecuador, ayudándolos a implementar soluciones tecnológicas que mejoran su gestión y rendimiento. Aunque atendemos a empresas de diversos sectores, nos especializamos en el trabajo con entidades gubernamentales, ofreciendo soluciones tecnológicas que optimizan procesos críticos.</p><p>Nos mantenemos a la vanguardia de la industria a través de <strong>proyectos de investigación continua</strong>, lo que nos permite ofrecer a nuestros clientes las últimas innovaciones y tendencias en el ámbito tecnológico.</p>', '1-10', '22-09-2024 04:09 AM [EAT +03:00]', 'employer', 'www.NexoByte', '2f736f83b3abbe013fef14e8029f2788', 'CM835956647');
INSERT INTO `tbl_users` (`first_name`, `last_name`, `gender`, `bdate`, `bmonth`, `byear`, `email`, `education`, `title`, `city`, `street`, `zip`, `country`, `phone`, `about`, `avatar`, `services`, `expertise`, `people`, `last_login`, `role`, `website`, `login`, `member_no`) VALUES
('Omar ', 'Sani', 'Male', '01', '01', '2024', 'admin@user', 'Tercer Nivel', 'Desarrollador De Software', 'Quito', 'Condado', '2024', 'Ecuador', '0959491061', '<div>Soy Omar Sani, desarrollador de software full stack con sede en Quito, Ecuador, enfocado en ciberseguridad. Cuento con experiencia en diversas tecnologías, incluyendo Java, PHP, TypeScript, Vue, Bootstrap, MySQL y MongoDB. Mi formación académica incluye estudios en contabilidad en el Instituto Tecnológico Superior Gran Colombia y una ingeniería en Desarrollo de Software en el Instituto Tecnológico Superior Nelson Torres.</div><div><br></div><div>A lo largo de mi carrera, he acumulado un año de experiencia laboral, con roles clave en la Comandancia General del Estado, donde me desempeñé como administrador de redes de dominio y responsable del mantenimiento de equipos. También colaboré con el Municipio de Cayambe, donde desarrollé el proyecto SPGCT, una solución tecnológica diseñada para automatizar el proceso de levantamiento de datos junto con el departamento de desarrollo productivo.</div><div><br></div><div>He logrado importantes certificaciones, como en Big Data y un curso especializado en Inteligencia Artificial con énfasis en prompt engineering. Mi enfoque profesional está orientado hacia la ciberseguridad y la inteligencia artificial, con el objetivo de desarrollar aplicaciones integrales que respondan a las necesidades tecnológicas actuales.</div><div><br></div><div>Entre mis proyectos más destacados, figuran mi página personal, donde presento mi portafolio profesional, y la creación de *EmpleaTec*, una plataforma web y móvil diseñada para servir como bolsa de empleo para los estudiantes y graduados del Instituto Nelson Torres. Además, participé en el desarrollo del proyecto municipal SPG-CT, enfocado en la automatización de procesos. Mi objetivo a largo plazo es seguir ampliando mi expertise en ciberseguridad e inteligencia artificial, y contribuir con soluciones tecnológicas innovadoras.</div>', , NULL, NULL, '-', '23-09-2024 06:09 PM [EAT +03:00]', 'employee', '-', '4f5cec75c744bd39b5126debbb7cffb8', 'EM073265743');
